// main.js는 vue 애플리케이션의 시작점
import { createApp } from 'vue'
import App from './App.vue'
import router from 'vue-router'
// createApp(App).mount('#app') // mount : app.vue파일을 빌드해서 mount
const app = createApp(App);

app.use(router);
app.mount('#app');
